import React from 'react'
import { useState, useEffect } from 'react';

import { CityCard } from './CityCard'

export const CitiesList = () => {
  const [cityList, setCityList] = useState ([{city: 'Madrid', temp: '38', id:0}, 
  {city: 'London', temp: '11', id:1}]);

  const items = cityList.map((item) =>
        <li key={item.id}><CityCard data = {[item.city, item.temp]}/></li>
  );

  const a = function () {
    setCityList(cityList.push({city: 'Madrid', temp: '38', id:2}))
  }
  return (
    <div className='row citiesList'>
        <div className='col-12'>
            <ul>
               {items}
            </ul>
            <button></button>
        </div>
    </div>
  )
}
